import React, { useState, useEffect } from 'react';
import { Bar } from 'react-chartjs-2';
import { Chart, registerables } from 'chart.js';
Chart.register(...registerables);

function InventoryList() {
  const [items, setItems] = useState([]);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    async function fetchData() {
      try {
        const response = await fetch('http://localhost:5000/api/healthcare');
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const data = await response.json();
        setItems(data);
      } catch (error) {
        console.error('Error fetching data:', error);
        setError(error.message);
      } finally {
        setLoading(false);
      }
    }

    fetchData();
  }, []);

  // Prepare data for the bar chart
  const chartData = {
    labels: items.map(item => item.item_name),
    datasets: [{
      label: 'Quantity',
      data: items.map(item => item.quantity),
      backgroundColor: 'rgba(75, 192, 192, 0.2)',
      borderColor: 'rgba(75, 192, 192, 1)',
      borderWidth: 1,
    }]
  };

  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100 p-6">
      <h1 className="text-4xl font-bold mb-8 text-center text-gray-800">Inventory Overview</h1>
      {loading ? (
        <p className="text-blue-500 text-lg">Loading data, please wait...</p>
      ) : error ? (
        <p className="text-red-500 text-lg mb-4">Error: {error}</p>
      ) : items.length > 0 ? (
        <div className="w-full max-w-5xl space-y-6">
          {/* Bar Chart */}
          <div className="bg-white p-6 shadow-md rounded-lg mb-8">
            <h2 className="text-2xl font-semibold mb-4">Product Quantities</h2>
            <Bar data={chartData} options={{
              responsive: true,
              plugins: {
                legend: {
                  position: 'top',
                },
                tooltip: {
                  callbacks: {
                    label: function(tooltipItem) {
                      return `Quantity: ${tooltipItem.raw}`;
                    }
                  }
                }
              },
              scales: {
                x: {
                  ticks: {
                    autoSkip: false,
                    maxRotation: 90,
                    minRotation: 45,
                  }
                }
              }
            }} />
          </div>

          {/* Product Details */}
          {items.map((item, index) => (
            <div key={index} className="flex flex-col md:flex-row bg-white border border-gray-300 rounded-lg shadow-md overflow-hidden mb-4">
              <img
                src={item.camera_photo}
                alt={item.item_name}
                className="w-full md:w-1/3 h-48 md:h-auto object-cover"
              />
              <div className="p-6 flex flex-col justify-between">
                <h2 className="text-2xl font-semibold mb-2">{item.item_name}</h2>
                <p className="text-gray-600 mb-1">
                  <span className="font-medium text-gray-800">Quantity:</span> {item.quantity}
                </p>
                <p className="text-gray-600 mb-1">
                  <span className="font-medium text-gray-800">Location:</span> {item.location}
                </p>
                <p className="text-gray-600 mb-1">
                  <span className="font-medium text-gray-800">Expiry Date:</span> {new Date(item.expiry_date).toLocaleDateString()}
                </p>
                <p className="text-gray-600 mb-1">
                  <span className="font-medium text-gray-800">Manufacturing Date:</span> {new Date(item.manufacturing_date).toLocaleDateString()}
                </p>
                <p className="text-gray-600 mb-1">
                  <span className="font-medium text-gray-800">Manufacturer:</span> {item.manufacturer_name}
                </p>
                <p className="text-gray-600 mb-1">
                  <span className="font-medium text-gray-800">Authority Email:</span> {item.authority_email}
                </p>
                <p className="text-gray-600 mb-1">
                  <span className="font-medium text-gray-800">Department:</span> {item.department_name}
                </p>
              </div>
            </div>
          ))}
        </div>
      ) : (
        <p className="text-gray-500 text-lg text-center">No inventory items found.</p>
      )}
    </div>
  );
}

export default InventoryList;
